css:
.atom-jshint-error {
  color: #cc0000;
}
.atom-jshint-pane {
  font-size: 11px;
  line-height: 22px;
  color: #aaaaaa;
  font-weight: normal;
  background-color: #1d1f21;
  overflow: auto;
  max-height: 80px;
  border-top: 1px solid rgba(0, 0, 0, 0.5);
  padding: 0 12.5px;
  cursor: pointer;
}
.atom-jshint-pane span:hover {
  text-decoration: underline;
}
